import { NavLink } from "react-router-dom";
import Logo from '../img/logo.png'

const Navbar = () => {
return(
<>
<div><img src={Logo} alt="Logo FootbalLife"></img></div>
<ul>
<li><NavLink to="">Home</NavLink></li>
<li><NavLink to="campionati">Campionati</NavLink></li> 
<li><NavLink to="squadre">Squadre</NavLink></li> 
<li><NavLink to="calciatori">Calciatori</NavLink></li> 
<li><NavLink to="contatti">Contatti</NavLink></li>   
</ul>
</>
)};

export default Navbar;
